INSERT INTO `information_description` (`information_id`, `language_id`, `title`, `description`) VALUES
(4, 2, 'About Us', '&lt;p&gt;\r\n	About Us&lt;/p&gt;\r\n'),
(5, 2, 'Terms &amp; Conditions', '&lt;p&gt;\r\n	Terms &amp;amp; Conditions&lt;/p&gt;\r\n'),
(3, 2, 'Privacy Policy', '&lt;p&gt;\r\n	Privacy Policy&lt;/p&gt;\r\n'),
(6, 2, 'Delivery Information', '&lt;p&gt;\r\n	Delivery Information&lt;/p&gt;\r\n'),
(7, 2, 'Как искать и оформить запрос?', '&lt;p&gt;\r\n	&lt;strong&gt;1. Выбор товара&lt;/strong&gt;&lt;br /&gt;\r\n	Выберите нужную Вам категорию товара в каталоге. Если у Вас есть вопросы относительно той или иной модели, Вы можете задать вопрос консультанту по телефону, либо оставить сообщение в форме обратной связи, с помощью которой наш консультант ответит на ваши вопросы.&lt;br /&gt;\r\n	&amp;nbsp;&lt;br /&gt;\r\n	&lt;strong&gt;2. Помещение товара в корзину&lt;/strong&gt;&lt;br /&gt;\r\n	Выбрав необходимый товар, добавьте их в список выбранных товаров. Количество предметов, которые Вы можете положить в свою корзину, не ограничено.&lt;br /&gt;\r\n	&amp;nbsp;&lt;br /&gt;\r\n	&lt;strong&gt;3. Оформление заказа&lt;/strong&gt;&lt;br /&gt;\r\n	Для оформления заказа кликните на &quot;Оформление заказа&quot;. Просмотрите ее содержимое. Вы можете изменить количество экземпляров товара, добавить или удалить отдельные. Окончательно определившись с товарами, нажмите кнопку &quot;Оформление заказа&quot;.&lt;br /&gt;\r\n	&amp;nbsp;&lt;br /&gt;\r\n	&lt;strong&gt;4. Оформление заказа&lt;/strong&gt;&lt;br /&gt;\r\n	Наш интернет-магазин поддерживает два варианта оформление заказа. Первый вариант потребует создания новой учетной записи, для этого выберите пункт &quot;Регистрация&quot; и заполните информацию о себе. Если вы уже зарегистрированы в нашем магазине, то вы можете выполнить вход заполнив поля логин и пароль. Обратите внимание, что поля, отмеченные \'*\', обязательны для заполнения. В поле &quot;Город&quot; укажите название населенного пункта, куда будет производиться доставка. Не забудьте указать контактный телефон, по которому наш оператор свяжется с вами и уточнит все детали вашего заказа.&amp;nbsp; При повторных покупках вы можете совершать покупки как постоянный клиент, при этом время заказа значительно сокращается и Вы получаете скидку.&lt;br /&gt;\r\n	&amp;nbsp;&lt;br /&gt;\r\n	&lt;strong&gt;5. Выбор формы оплаты&lt;/strong&gt;&lt;br /&gt;\r\n	Если товар Вас устраивает, и Вы хотите его приобрести, пожалуйста, напишите свои уточнения и пожелания о дате и времени доставки, укажите способ оплаты: оплата наличными или безналичный, В случае оплаты за наличный расчет курьер доставит товар в оговоренное время по указанному адресу. Оплата принимается в российских рублях строго в соответствии с ценой, указанной в кассовом и товарном чеках. Для оплаты товара по безналичному расчету юридическим лицам после поступления заказа высылается счет. Для этого необходимо при оформлении заказа указать название организации-плательщика и ее реквизиты.&lt;br /&gt;\r\n	&amp;nbsp;&lt;br /&gt;\r\n	&lt;strong&gt;6. Подтверждение ваших данных&lt;/strong&gt;&lt;br /&gt;\r\n	Ещё раз проверьте ваши данные, контактную информацию, адрес доставки, телефон, время доставки, способ оплаты. Если что-то указанно неправильно или не устраивает вас, вы можете вернутся назад, нажав на Корзину. Если вся информация указана верно, нажмите на ссылку &quot;Оформить заказ. При поступлении Вашего заказа, наш оператор свяжется с Вами для уточнения времени доставки. Наши экспедиторы доставят заказ непосредственно по указанному адресу. Доставка товара по Кировской области зависит от расстояния и обговаривается отдельно.&lt;br /&gt;\r\n	&amp;nbsp;&lt;br /&gt;\r\n	&lt;strong&gt;Желаем Вам удачных покупок!&lt;/strong&gt;&lt;/p&gt;\r\n'),
(8, 2, 'Файлы cookie', '&lt;p&gt;\r\n	Файлы cookie — это автоматизированное средство, с помощью которого мы собираем информацию на нашем веб-сайте и иногда можем отслеживать информацию о том, как именно посетители им пользуются. Эти файлы позволяют нам сделать сайт более удобным и функциональным, а наше обслуживание — более качественным. Когда вы заходите на наш сайт, наш веб-сервер отправляет на ваш компьютер файл cookie, который позволяет нам распознать ваш компьютер, а вам — пользоваться функционалом сайта.&lt;/p&gt;\r\n&lt;p&gt;\r\n	Продолжая пользоваться сайтом и открывая другие страницы, вы соглашаетесь с нашими настройками для файлов cookie и подтверждаете, что вы понимаете данную Политику в отношении файлов cookie и Заявление о конфиденциальности. Обращаем ваше внимание на то, что с помощью настроек браузера вы можете установить ограничения для файлов cookie, но подобные ограничения могут отрицательно сказаться на удобстве пользования сайтом и его функционале.&lt;/p&gt;\r\n&lt;p&gt;\r\n	&amp;nbsp;&lt;/p&gt;\r\n&lt;p&gt;\r\n	&lt;strong&gt;Что делают файлы cookie?&lt;/strong&gt;&lt;/p&gt;\r\n&lt;p&gt;\r\n	1. Файлы cookie поддерживают основной функционал веб-сайта. Некоторые файлы cookie необходимы для поддержания базового функционала нашего веб-сайта. Например, именно они сохраняют информацию о товарах, которые вы положили в корзину, пока вы выбираете другие товары и просматриваете разные страницы нашего сайта.&lt;/p&gt;\r\n&lt;p&gt;\r\n	2. Файлы cookie позволяют нам улучшать работу нашего сайта и повышать качество наших услуг. Файлы cookie собирают информацию (иногда в том числе и IP-адреса), благодаря чему мы можем узнать, как вы пользуетесь нашим веб-сайтом, и повысить его удобство и качество наших услуг. На основе этой информации мы можем:&lt;/p&gt;\r\n&lt;p&gt;\r\n	&amp;nbsp;&amp;nbsp;&amp;nbsp; - предоставлять совокупную анонимную статистику пользования нашим сайтом;&lt;br /&gt;\r\n	&amp;nbsp;&amp;nbsp;&amp;nbsp; - оценивать эффективность нашей рекламы — мы отслеживаем, на какие ссылки вы нажимаете и с какого веб-сайта вы переходите на наш;&lt;br /&gt;\r\n	&amp;nbsp;&amp;nbsp;&amp;nbsp; - сообщать избранным сторонним компаниям из числа наших проверенных партнеров о том, что наши посетители переходят на их веб-сайты;&lt;br /&gt;\r\n	&amp;nbsp;&amp;nbsp;&amp;nbsp; - оптимизировать работу сайта путем фиксирования и устранения проблем, с которыми сталкиваются пользователи;&lt;br /&gt;\r\n	&amp;nbsp;&amp;nbsp;&amp;nbsp; - расширять функционал сайта, например открывать доступ к дополнительным услугам или восстанавливать содержимое вашей корзины, если вы закрыли сайт и заходите на него повторно.&lt;/p&gt;\r\n&lt;p&gt;\r\n	3. Файлы cookie могут передавать информацию избранным сторонним компаниям из числа наших проверенных партнеров. Сторонние файлы cookie могут передавать информацию нашим партнерам — это необходимо для определенных функций нашего сайта. Передаваемая информация используется исключительно для того, чтобы сделать определенные услуги или функции возможными (например, чтобы активировать такие кнопки социальных сетей, как «Нравится» или «Поделиться»). Некоторые сторонние файлы cookie могут использоваться для того, чтобы учитывать ваши предпочтения и оказывать вам услуги в соответствии с вашими интересами (см. раздел «Реклама по интересам») как на этом веб-сайте, так и на некоторых других сайтах. Некоторые из этих персонализированных услуг могут быть связаны с теми услугами третьих лиц, которые эти третьи лица оказывают с целью отметить тот факт, что вы посетили наш веб-сайт. Данная информация используется для того, чтобы сообщать вам о продукции КировМазДеталь и услугах, которые могут вас заинтересовать. Такие файлы cookie могут также взаимодействовать с социальными сетями, такими как, например, Facebook, или передавать рекламным агентствам информацию о вашем посещении, с тем чтобы они могли показывать вам рекламные объявления о продукции КировМазДеталь и услугах, которые могут быть вам интересны.&lt;/p&gt;\r\n&lt;p&gt;\r\n	&amp;nbsp;&lt;/p&gt;\r\n&lt;p&gt;\r\n	&lt;strong&gt;Как устанавливать предпочтения для файлов cookie&lt;/strong&gt;&lt;/p&gt;\r\n&lt;p&gt;\r\n	Чтобы установить предпочтения для сторонних файлов cookie, передаваемых с нашего сайта, необходимо перейти на соответствующие сайты, перечисленные ниже:&lt;/p&gt;\r\n&lt;p&gt;\r\n	&amp;nbsp;&amp;nbsp;&amp;nbsp; - Google Analytics: &lt;a href=&quot;http://www.google.com/analytics/learn/privacy.html&quot;&gt;http://www.google.com/analytics/learn/privacy.html&lt;/a&gt;&lt;br /&gt;\r\n	&amp;nbsp;&amp;nbsp;&amp;nbsp; - Adobe Analytics: &lt;a href=&quot;http://www.adobe.com/privacy/analytics.html#1&quot;&gt;http://www.adobe.com/privacy/analytics.html#1&lt;/a&gt;&lt;br /&gt;\r\n	&amp;nbsp;&amp;nbsp;&amp;nbsp; - Sizmek: &lt;a href=&quot;http://www.sizmek.com/about-us/privacy&quot;&gt;http://www.sizmek.com/about-us/privacy&lt;/a&gt;&lt;/p&gt;\r\n&lt;p&gt;\r\n	Чтобы установить предпочтения для всех файлов cookie на нашем сайте, в том числе для тех, которые передаем мы, необходимо изменить настройки вашего браузера. Подробную информацию о том, как управлять любыми файлами cookie, можно получить на сайте &lt;a href=&quot;http://www.allaboutcookies.org/&quot;&gt;http://www.allaboutcookies.org/&lt;/a&gt;. Обращаем ваше внимание на то, что отключение, блокировка и удаление файлов cookie с помощью настроек браузера может привести к тому, что вы не сможете воспользоваться функционалом нашего сайта в полном объеме.&lt;/p&gt;\r\n&lt;p&gt;\r\n	В нашем Заявлении о конфиденциальности более подробно прописано, какую именно информацию о вас мы собираем и как мы используем ваши персональные данные, которые вы нам сообщаете, однако не всякая информация, собранная с использованием файлов cookie, позволяет идентифицировать пользователя.&lt;/p&gt;\r\n'),
(9, 2, 'Политика конфиденциальности', '&lt;p&gt;\r\n	Компания КировМазДеталь очень серьезно относится к защите персональных данных. Следующие пять принципов лежат в основе нашего подхода к конфиденциальности:&lt;/p&gt;\r\n&lt;ol&gt;\r\n	&lt;li&gt;\r\n		Мы ценим доверие, которое Вы оказываете нам, предоставляя Вашу личную информацию. Мы всегда будем использовать Вашу личную информацию честным и достойным доверия путем.&lt;/li&gt;\r\n	&lt;li value=&quot;2&quot;&gt;\r\n		Вы имеете право получить достоверную информацию о том, как мы используем Ваши персональные данные. Для Вас должно всегда быть понятным то, какую информацию мы собираем, что мы с ней делаем, с кем мы делимся ею, и к кому следует обратиться, если у Вас возникли какие-либо проблемы.&lt;/li&gt;\r\n	&lt;li value=&quot;3&quot;&gt;\r\n		Если у Вас возникли какие-либо вопросы о том, как мы используем Вашу личную информацию, мы будем рады сотрудничать с Вами, чтобы оперативно решить все вопросы.&lt;/li&gt;\r\n	&lt;li value=&quot;4&quot;&gt;\r\n		Мы предпримем все необходимые меры для защиты личной информации от неправомерного использования и сохраним ее в безопасном месте.&lt;/li&gt;\r\n	&lt;li value=&quot;5&quot;&gt;\r\n		Мы будем соблюдать все действующие законы и правила о защите данных и сотрудничать со службами по защите данных. При отсутствии законодательства о защите данных, мы будем действовать в соответствии с общепринятыми принципами защиты данных.&lt;/li&gt;\r\n&lt;/ol&gt;\r\n&lt;p&gt;\r\n	&amp;nbsp;&lt;/p&gt;\r\n&lt;p&gt;\r\n	&lt;strong&gt;ПОЛИТИКА КОНФИДЕНЦИАЛЬНОСТИ КОМПАНИИ&lt;/strong&gt;&lt;/p&gt;\r\n&lt;p&gt;\r\n	Компания КировМазДеталь стремится сохранить конфиденциальность Ваших личных данных и обеспечить защиту Вашей личной информации. Данная Политика конфиденциальности определяется тем, какие типы личной информации мы собираем, как мы ее используем, раскрываем и защищаем.&lt;/p&gt;\r\n&lt;p&gt;\r\n	Политика конфиденциальности распространяется на личную информацию, собранную компанией КировМазДеталь, в связи с услугами, которые она предлагает. Эта информация включает в себя данные, собранные в режиме онлайн через наш веб-сайт (&quot;Cайт КировМазДеталь&quot;).&lt;/p&gt;\r\n&lt;p&gt;\r\n	Политика конфиденциальности является неотъемлемой частью правил и условий использования веб-сайта компании КировМазДеталь. Дополнительную информацию о компании КировМазДеталь Вы можете найти в разделе контактов.&lt;/p&gt;\r\n&lt;p&gt;\r\n	&amp;nbsp;&lt;/p&gt;\r\n&lt;p&gt;\r\n	&lt;strong&gt;Политика конфиденциальности не распространяется на:&lt;/strong&gt;&lt;/p&gt;\r\n&lt;ul&gt;\r\n	&lt;li&gt;\r\n		информацию, собранную со сторонних веб-сайтов, платформ и / или приложений (&quot;Сайты Третьих сторон&quot;) которые мы не контролируем;&lt;/li&gt;\r\n	&lt;li&gt;\r\n		информацию, собранную на сайтах, принадлежащим третьим лицам, доступ к которым Вы получили, перейдя по ссылке на сайте компании КировМазДеталь;&lt;/li&gt;\r\n	&lt;li&gt;\r\n		баннеры, лотереи и другие объявления или рекламные акции, которые мы можем финансировать или участвовать на сайтах третьих лиц.&lt;/li&gt;\r\n&lt;/ul&gt;\r\n&lt;p&gt;\r\n	Сторонние сайты могут иметь свою собственную политику конфиденциальности, условия и правила использования информации. Мы рекомендуем Вам ознакомиться с ними, прежде чем пользоваться сайтами третьих лиц.&lt;/p&gt;\r\n&lt;p&gt;\r\n	&amp;nbsp;&lt;/p&gt;\r\n&lt;p&gt;\r\n	&lt;strong&gt;Ваше согласие&lt;/strong&gt;&lt;/p&gt;\r\n&lt;p&gt;\r\n	Компания КировМазДеталь не будет собирать, использовать или раскрывать Вашу личную информацию без Вашего согласия. В большинстве случаев мы просим Вашего согласия напрямую, но иногда мы можем сделать вывод о Вашем согласии, следуя из Ваших действий и поведения. Пользуясь сайтом компании КировМазДеталь, Вы тем самым даете согласие на сбор, использование и раскрытие Вашей личной информации компанией КировМазДеталь в соответствии с данной Политикой конфиденциальности.&lt;/p&gt;\r\n&lt;p&gt;\r\n	Мы можем дополнительно просить Вашего согласия на использование Вашей личной информации для целей, на которые данная Политика конфиденциальности не распространяется. Вы не обязаны соглашаться, но если Вы решите не давать своего согласия, Ваше участие в определенных мероприятиях может быть ограничено. Если Вы даете свое согласие на дополнительные условия, они должны превалировать в случае их расхождения с условиями настоящей Политики конфиденциальности.&lt;/p&gt;\r\n&lt;p&gt;\r\n	Если Вы не согласны на сбор, использование и раскрытие Вашей личной информации таким образом, пожалуйста, не используйте сайты компании КировМазДеталь или предоставьте личную информацию компании КировМазДеталь другим способом.&lt;/p&gt;\r\n&lt;p&gt;\r\n	&amp;nbsp;&lt;/p&gt;\r\n&lt;p&gt;\r\n	&lt;strong&gt;Дети&lt;/strong&gt;&lt;/p&gt;\r\n&lt;p&gt;\r\n	Сайт компании КировМазДеталь разработан и предназначен для совершеннолетних пользователей. В случае если сайт КировМазДеталь предназначен для более молодой аудитории, мы получим согласие родителей или опекунов, прежде чем собирать личную информацию в случаях, предусмотренных существующими законами о защите данных (возраст, в котором требуется получение согласия, зависит от страны). Если Вы не достигли совершеннолетия, Вам необходимо ознакомиться с условиями настоящей Политики конфиденциальности вместе с Вашим родителями или опекуном, чтобы убедиться, что Вы понимаете и принимаете ее условия. Если мы обнаружим, что собрали информацию без согласия родителей или опекунов, мы удалим эту информацию как можно скорее.&lt;/p&gt;\r\n&lt;p&gt;\r\n	Доступ к некоторым частям сайта компании КировМазДеталь и / или право на получение призов, образцов или других вознаграждений может иметь возрастные ограничения. Мы можем использовать Ваши персональные данные для проверки возраста и применять любые возрастные ограничения.&lt;/p&gt;\r\n&lt;p&gt;\r\n	&amp;nbsp;&lt;/p&gt;\r\n&lt;p&gt;\r\n	&lt;strong&gt;Какую информацию мы собираем?&lt;/strong&gt;&lt;/p&gt;\r\n&lt;p&gt;\r\n	Согласно Политике конфиденциальности понятие &quot;личной информации&quot; включает информацию, или часть информации, которая позволяет Вас идентифицировать. Обычно она включает в себя имя, адрес, псевдоним (ник), фотографию, адрес электронной почты и номер телефона, но также может включать другую информацию, такую как IP-адрес, покупательские привычки, предпочтения и информацию о Вашем образе жизни, хобби и интересах. Мы можем собирать личную информацию о Вас из различных источников, в том числе - информацию, которую Вы лично предоставляете нам.&lt;/p&gt;\r\n&lt;p&gt;\r\n	Мы можем получить информацию непосредственно от Вас, например, при регистрации для участия в розыгрышах и конкурсах, подписке на получение информации, при использовании приложения, покупке нашего продукта или услуги, заполнении анкеты, или при написании комментария или запроса. Информация, которую мы можем получить напрямую от Вас, включает:&lt;/p&gt;\r\n&lt;ul&gt;\r\n	&lt;li&gt;\r\n		адрес&lt;/li&gt;\r\n	&lt;li&gt;\r\n		email адрес&lt;/li&gt;\r\n	&lt;li&gt;\r\n		имя пользователя&lt;/li&gt;\r\n	&lt;li&gt;\r\n		номер телефона&lt;/li&gt;\r\n	&lt;li&gt;\r\n		информацию об оплате кредитной картой или других видах платежей&lt;/li&gt;\r\n	&lt;li&gt;\r\n		возраст&lt;/li&gt;\r\n	&lt;li&gt;\r\n		дату рождения&lt;/li&gt;\r\n	&lt;li&gt;\r\n		пол&lt;/li&gt;\r\n	&lt;li&gt;\r\n		пользовательский контент, сообщения и другие материалы, которые Вы выкладываете на сайтах КировМазДеталь&lt;/li&gt;\r\n	&lt;li&gt;\r\n		любую другую личную информацию, которую Вы добровольно предоставляете нам&lt;/li&gt;\r\n	&lt;li&gt;\r\n		информацию, поступающую автоматически при использовании сайта компании КировМазДеталь&lt;/li&gt;\r\n&lt;/ul&gt;\r\n&lt;p&gt;\r\n	Мы используем файлы cookies и другие инструменты (например, инструменты веб-аналитики), автоматически собирая информацию, когда Вы пользуетесь сайтами компании КировМазДеталь. Информация, которую мы можем получить автоматически, включает:&lt;/p&gt;\r\n&lt;ul&gt;\r\n	&lt;li&gt;\r\n		информацию о типе используемого браузера&lt;/li&gt;\r\n	&lt;li&gt;\r\n		детали просмотренные Вами страницы&lt;/li&gt;\r\n	&lt;li&gt;\r\n		Ваш IP-адрес&lt;/li&gt;\r\n	&lt;li&gt;\r\n		гиперссылки, по которым Вы перешли&lt;/li&gt;\r\n	&lt;li&gt;\r\n		Ваше имя пользователя, изображение профиля, пол, сети и любую другую информацию, которой Вы хотите поделиться, используя сайты третьих лиц (например, при нажатии «Мне нравится» в Facebook или «+1» в Google +);&lt;/li&gt;\r\n	&lt;li&gt;\r\n		веб-сайты, которые Вы посетили, прежде чем зайти на сайт компании КировМазДеталь&lt;/li&gt;\r\n&lt;/ul&gt;\r\n&lt;p&gt;\r\n	Большинство интернет-браузеров по умолчанию настроены на прием cookies. Вы можете изменить настройки, чтобы блокировать cookies, или установить предупреждение об отправке cookies на устройство. Отключение cookies может влиять на Вашу работу с сайтом КировМазДеталь&lt;/p&gt;\r\n&lt;p&gt;\r\n	&amp;nbsp;&lt;/p&gt;\r\n&lt;p&gt;\r\n	&lt;strong&gt;Информацию, которую мы получаем из других источников&lt;/strong&gt;&lt;/p&gt;\r\n&lt;p&gt;\r\n	Мы можем получать личную информацию о Вас из других источников, если Вы дали разрешение на ее получение. Это может быть информация из доступных коммерческих источников, таких как общедоступные базы данных и агрегаторы данных, а также информация от третьих лиц. Личная информации, которую мы можем получить из таких источников, включает:&lt;/p&gt;\r\n&lt;ul&gt;\r\n	&lt;li&gt;\r\n		имя&lt;/li&gt;\r\n	&lt;li&gt;\r\n		почтовый адрес&lt;/li&gt;\r\n	&lt;li&gt;\r\n		возраст&lt;/li&gt;\r\n	&lt;li&gt;\r\n		Ваши покупательские привычки и предпочтения&lt;/li&gt;\r\n	&lt;li&gt;\r\n		общедоступную информацию, такую как контент, блоги и посты, получение которой не запрещено действующим законодательством&lt;/li&gt;\r\n&lt;/ul&gt;\r\n&lt;p&gt;\r\n	&amp;nbsp;&lt;/p&gt;\r\n&lt;p&gt;\r\n	&lt;strong&gt;Как мы используем Вашу личную информацию? Мы можем использовать информацию о Вас для того, чтобы:&lt;/strong&gt;&lt;/p&gt;\r\n&lt;ul&gt;\r\n	&lt;li&gt;\r\n		улучшить качество наших продуктов и работу сайтов компании КировМазДеталь&lt;/li&gt;\r\n	&lt;li&gt;\r\n		оценить использование сайтов, продуктов и услуг КировМазДеталь&lt;/li&gt;\r\n	&lt;li&gt;\r\n		оценить эффективность нашей рекламы, конкурсов и кампаний по продвижению товаров&lt;/li&gt;\r\n	&lt;li&gt;\r\n		индивидуализировать Вашу работу с нашим сайтом и составить статистику (анонимно) Вашей активности на сайте, включая время посещение сайта, предыдущие посещения сайта, адрес сайта, который отослал Вас на сайт компании КировМазДеталь&lt;/li&gt;\r\n	&lt;li&gt;\r\n		упростить использование сайта КировМазДеталь, а так же адаптировать его работу и нашу продукцию для Ваших интересов и потребностей&lt;/li&gt;\r\n	&lt;li&gt;\r\n		ускорить работу с сайтом в будущем. Например, сайт распознает, что Вы предоставили личную информацию ранее, и не будет запрашивать ту же информацию во второй раз&lt;/li&gt;\r\n	&lt;li&gt;\r\n		собрать информацию об используемом Вами устройстве для просмотра сайта компании КировМазДеталь, включая IP-адрес, тип интернет-браузера или операционной системы, и связать ее с Вашей личной информацией для того, чтобы обеспечить самый высокий уровень работы в сети&lt;/li&gt;\r\n	&lt;li&gt;\r\n		связаться с Вами по поводу продуктов и услуг, которые могут представлять интерес для Вас, при условии, что Вы дали свое согласие на это, или ранее отправляли нам запрос о продукте или услуге, и нам необходимо связаться с Вами в течение срока, установленного действующим законом.&lt;/li&gt;\r\n&lt;/ul&gt;\r\n&lt;p&gt;\r\n	&amp;nbsp;&lt;/p&gt;\r\n&lt;p&gt;\r\n	&lt;strong&gt;Мы можем использовать информацию о Вас для того, чтобы:&lt;/strong&gt;&lt;/p&gt;\r\n&lt;ul&gt;\r\n	&lt;li&gt;\r\n		предлагать Вам продукты или услуги (в том числе от третьих лиц), которые, по нашему мнению, могут представлять интерес&lt;/li&gt;\r\n	&lt;li&gt;\r\n		предлагать Вам участие в конкурсах или рекламных кампаниях&lt;/li&gt;\r\n&lt;/ul&gt;\r\n&lt;p&gt;\r\n	Вы можете отказаться от получения сообщений от нас в любое время. Все инструменты маркетинговой коммуникации, которые мы отправляем Вам, содержат информацию о том, как отказаться от их получения.&lt;/p&gt;\r\n&lt;p&gt;\r\n	&amp;nbsp;&lt;/p&gt;\r\n&lt;p&gt;\r\n	&lt;strong&gt;Мы можем использовать Вашу личную информацию для того, чтобы&lt;/strong&gt;:&lt;/p&gt;\r\n&lt;ul&gt;\r\n	&lt;li&gt;\r\n		информировать Вас о конкурсах или рекламных акциях, в которых Вы намерены принять участие&lt;/li&gt;\r\n	&lt;li&gt;\r\n		отправлять Вам информацию, продукты или образцы в соответствии с Вашим запросом&lt;/li&gt;\r\n	&lt;li&gt;\r\n		отвечать на Ваши вопросы или комментарии&lt;/li&gt;\r\n&lt;/ul&gt;\r\n&lt;p&gt;\r\n	В случае если мы собираем личную информацию для определенных целей, мы не будем хранить ее дольше, чем это необходимо для выполнения данной цели, если только данную информацию не требуется хранить по причинам юридического характера. В целях защиты информации от случайного или преднамеренного уничтожения, при удалении информации с наших сервисов мы не можем немедленно удалить остаточные копии с наших серверов или удалить информацию из систем резервного копирования.&lt;/p&gt;\r\n&lt;p&gt;\r\n	&amp;nbsp;&lt;/p&gt;\r\n&lt;p&gt;\r\n	&lt;strong&gt;СМС рассылка&lt;/strong&gt;&lt;/p&gt;\r\n&lt;p&gt;\r\n	Мы можем предоставить услугу, с помощью которой Вы можете получать текстовые или другие типы сообщений от компании КировМазДеталь (короткие сообщения SMS, сообщения EMS, или мультимедийные сообщения MMS) на беспроводные и мобильные устройства (&quot;СМС рассылка&quot;). Если Вы подписаны на одну из наших рассылок, Вы даете свое согласие на получение таких сообщений от компании КировМазДеталь по адресу или номеру мобильного, который Вы предоставляете для этой цели (до тех пор, пока Вы не решите отказаться от получения таких сообщений, следуя инструкции в разделе Ваши права и список контактов).&lt;/p&gt;\r\n&lt;p&gt;\r\n	Вы должны понимать, что стандартные тарифы оператора мобильной связи распространяются и на данные сообщения, и что Вы можете передумать в любой момент, следуя инструкциям в разделе Ваши права и список контактов. Если с Вашего счета взимается плата, Вы соглашаетесь на то, что мы можем получить от Вас и предоставить Вашему оператору информацию по оплате. Вы подтверждаете, что Вы являетесь владельцем или законным пользователем беспроводного устройства, используемого для получения рассылки, и что Вы имеете право утвердить дополнительные расходы. В дополнение к определенным возрастным ограничениям и любым другим условиям предоставления СМС рассылки, может потребоваться регистрация личной информации, такой как Ваше имя, текст сообщения, адрес беспроводного устройства или номер мобильного телефона. Мы также можем получить информацию о дате, времени и содержании Ваших сообщений при использовании сервиса СМС рассылки. Мы будем использовать информацию, полученную с помощью сервиса СМС рассылки, в соответствии с Политикой конфиденциальности. Пожалуйста, обратите внимание, что Ваш оператор беспроводной связи и другие поставщики услуг могут также собирать данные об использовании Вами беспроводного устройства, и их деятельность регулируется их собственной политикой.&lt;/p&gt;\r\n&lt;p&gt;\r\n	Вы признаете и соглашаетесь, что услуга СМС рассылки осуществляется через беспроводные системы, которые используют радио (и другие средства) для передачи сообщений через сложные сети. Мы не гарантируем, что использование сервиса СМС рассылки будет конфиденциальным или безопасным, и мы не несем ответственности за отсутствие конфиденциальности или безопасности. Вы несете полную ответственность за принятие мер предосторожности и безопасности, которые лучше всего подходят Вам для использования сервиса СМС рассылки. Мы также можем получить доступ к содержимому счета Вашей беспроводного устройства или мобильного телефона у оператора с целью выявления и разрешения технических проблем и / или жалоб на оказываемую услугу.&lt;/p&gt;\r\n&lt;p&gt;\r\n	&amp;nbsp;&lt;/p&gt;\r\n&lt;p&gt;\r\n	&lt;strong&gt;С кем мы делимся Вашей личной информацией?&lt;/strong&gt;&lt;/p&gt;\r\n&lt;p&gt;\r\n	Как правило, мы не распространяем Вашу личную информацию за рамками компании КировМазДеталь. Однако, передача Ваших личных данных третьим сторонам, заслужившим наше доверие, возможна.&lt;/p&gt;\r\n&lt;p&gt;\r\n	&amp;nbsp;&lt;/p&gt;\r\n&lt;p&gt;\r\n	&lt;strong&gt;Мы можем передавать Ваши личные данные:&lt;/strong&gt;&lt;/p&gt;\r\n&lt;ul&gt;\r\n	&lt;li&gt;\r\n		нашим агентствам по рекламе, маркетингу и развитию для проведения и анализа эффективности наших рекламных кампаний и мероприятий по продвижению продуктов&lt;/li&gt;\r\n	&lt;li&gt;\r\n		третьим сторонам, осуществляющих доставку товаров или услуг для Вас, таким как служба доставки, либо почтовая служба, которые совершают доставку заказанного Вами товара;&lt;/li&gt;\r\n	&lt;li&gt;\r\n		правоохранительным органам либо государственным властям в рамках судебного процесса, требующего от нас раскрытия информации;&lt;/li&gt;\r\n	&lt;li&gt;\r\n		третьим сторонам, желающим отправлять Вам информацию об их товарах и услугах, но только в случае получения нами Вашего согласия;&lt;/li&gt;\r\n	&lt;li&gt;\r\n		сторонним поставщикам таких услуг, как обработка данных, провайдерам средств веб-аналитики КировМазДеталь;&lt;/li&gt;\r\n	&lt;li&gt;\r\n		таким как Google или Unica.&lt;/li&gt;\r\n&lt;/ul&gt;\r\n&lt;p&gt;\r\n	Мы также можем передавать Ваши личные данные сторонним компаниям, организациям или отдельным лицам, если посчитаем раскрытие данной информации необходимым по причинам юридического характера.&lt;/p&gt;\r\n&lt;p&gt;\r\n	&amp;nbsp;&lt;/p&gt;\r\n&lt;p&gt;\r\n	&lt;strong&gt;Мы можем передавать Ваши личные данные:&lt;/strong&gt;&lt;/p&gt;\r\n&lt;ul&gt;\r\n	&lt;li&gt;\r\n		для обеспечения соответствующих условий использования сайтов компании КировМазДеталь;&lt;/li&gt;\r\n	&lt;li&gt;\r\n		для проведения расследований при возможных нарушениях соответствующих законов;&lt;/li&gt;\r\n	&lt;li&gt;\r\n		для обнаружения и предотвращения случаев мошенничества и любых технических неполадок, либо неполадок в системе безопасности;&lt;/li&gt;\r\n	&lt;li&gt;\r\n		с целью исполнения соответствующих законов и правил; сотрудничества при проведении расследований и удовлетворения запросов соответствующих органов власти.&lt;/li&gt;\r\n&lt;/ul&gt;\r\n&lt;p&gt;\r\n	В случае распространения нами Ваших личных данных третьей стороне мы будем прилагать все усилия, чтобы гарантировать сохранность Вашей информации, предпринимать все допустимые меры по ее защите от несанкционированного использования, и использовать ее только согласно данной Политике Конфиденциальности и соответствующих законов и правил по защите данных.&lt;/p&gt;\r\n&lt;p&gt;\r\n	КировМазДеталь не продает личную информацию никому, кроме организаций, которым мы передаем весь или часть нашего бизнеса (например, при продажей нашего бренда), или в связи со слиянием, объединением, сменой управления, реорганизацией или ликвидацией всего бизнеса, либо его части.&lt;/p&gt;\r\n&lt;p&gt;\r\n	Мы можем передавать Ваши личные данные на серверы, расположенные за пределами страны, в которой Вы живете, либо дочерним компаниям и другим доверенным сторонам, расположенным в других странах, для их обработки от нашего имени. Используя сайты компании КировМазДеталь или предоставляя личную информацию компании КировМазДеталь иным способом, Вы даете свое согласие на эти действия в соответствии с условиями данной Политики конфиденциальности и действующими законами и правилами о защите информации.&lt;/p&gt;\r\n&lt;p&gt;\r\n	Вы должны помнить о том, что многие страны не предоставляют подобной правовой защиты личной информации, которой Вы можете пользоваться на родине. Находясь в другой стране, Ваши личные данные могут быть доступны для судебных инстанций, правоохранительных органов и органов государственной безопасности этой страны в соответствии с ее законами. При получении запроса на такой доступ от правоохранительных органов, мы берем на себя обязательство, что лицо, осуществляющее обработку Вашей личной информации за пределами Вашей страны, примет меры по их защите и произведет их обработку в соответствии с инструкциями компании КировМазДеталь.&lt;/p&gt;\r\n&lt;p&gt;\r\n	&amp;nbsp;&lt;/p&gt;\r\n&lt;p&gt;\r\n	&lt;strong&gt;Обеспечение защиты Ваших личных данных&lt;/strong&gt;&lt;/p&gt;\r\n&lt;p&gt;\r\n	Мы предпринимаем все разумные меры предосторожности для сохранности Ваших личных данных и требуем того же от третьих лиц, которые анализируют или обрабатывают ваши персональные данные для нас. Доступ к Вашим личным данным ограничен в целях предотвращения несанкционированного доступа, изменения или неправомерного использования, и разрешен только для наших сотрудников и агентов на основе принципа служебной необходимости.&lt;/p&gt;\r\n&lt;p&gt;\r\n	&amp;nbsp;&lt;/p&gt;\r\n&lt;p&gt;\r\n	&lt;strong&gt;Ваши права и список контактов&lt;/strong&gt;&lt;/p&gt;\r\n&lt;p&gt;\r\n	Если у Вас возникли вопросы, комментарии или замечания по поводу того, как мы обрабатываем Ваши личные данные, Вы можете связаться с нами, перейдя по ссылке Связаться с нами на сайте КировМазДеталь.&lt;/p&gt;\r\n&lt;p&gt;\r\n	&amp;nbsp;&lt;/p&gt;\r\n&lt;p&gt;\r\n	&lt;strong&gt;У Вас есть право сообщить нам, если Вы:&lt;/strong&gt;&lt;/p&gt;\r\n&lt;ul&gt;\r\n	&lt;li&gt;\r\n		не хотите получать от нас сообщения в будущем,&lt;/li&gt;\r\n	&lt;li&gt;\r\n		хотели бы получить копию Ваших личных данных, которые хранятся у нас,&lt;/li&gt;\r\n	&lt;li&gt;\r\n		хотели бы исправить, обновить или удалить Ваши личные данные из нашего архива,&lt;/li&gt;\r\n	&lt;li&gt;\r\n		хотите сообщить о несанкционированном использовании Ваших личных данных.&lt;/li&gt;\r\n&lt;/ul&gt;\r\n&lt;p&gt;\r\n	&amp;nbsp;&lt;/p&gt;\r\n&lt;p&gt;\r\n	&lt;strong&gt;Изменения в нашей Политике конфиденциальности&lt;/strong&gt;&lt;/p&gt;\r\n&lt;p&gt;\r\n	По мере необходимости мы можем изменить Политику конфиденциальности путем размещения ее обновленной версии на сайте компании КировМазДеталь. Мы уведомим Вас о любом существенном изменении заблаговременно. Мы призываем Вас чаще посещать Другие политики конфиденциальности компании КировМазДеталь чтобы быть в курсе того, как мы используем вашу личную информацию.&lt;/p&gt;\r\n&lt;p&gt;\r\n	В качестве дополнения к данной Политике конфиденциальности могут существовать отдельные кампании и рекламные акции на сайтах компании КировМазДеталь, которые будут регулироваться дополнительными условиями конфиденциальности или политикой. Мы рекомендуем Вам ознакомиться с этими дополнительными условиями или политикой, прежде чем принимать в них участие, так как Вы будете обязаны их соблюдать. Любые дополнительные условия конфиденциальности или политики будут находиться в открытом доступе.&lt;/p&gt;\r\n'),
(10, 2, 'Пользовательское соглашение', '&lt;p&gt;\r\n	Пользуясь услугами интернет-магазина «КировМазДеталь» (далее — Сервис), пользователь соглашается с настоящими Правилами, а также с Пользовательским. Отношение к персональной информации пользователей регламентируется Политикой конфиденциальности.&lt;/p&gt;\r\n&lt;p&gt;\r\n	Правила выставления оценок и написания отзывов:&lt;/p&gt;\r\n&lt;ul&gt;\r\n	&lt;li&gt;\r\n		оставлять отзывы о магазинах и товарах, размещенных на сайте «КировМазДеталь», может любой пользователь — как зарегистрированный, так и не зарегистрированный;&lt;/li&gt;\r\n	&lt;li&gt;\r\n		ставить оценки товарам может также любой пользователь;&lt;/li&gt;\r\n	&lt;li&gt;\r\n		отзывы, оставленные пользователями, могут быть опубликованы;&lt;/li&gt;\r\n	&lt;li&gt;\r\n		пользователи не могут изменять (редактировать) и удалять свои оценки и отзывы.&lt;/li&gt;\r\n&lt;/ul&gt;\r\n&lt;p&gt;\r\n	Пользователь соглашается, что оставленные им отзывы и поставленные оценки могут быть опубликованы для ознакомления третьими лицами — пользователями Сервиса. При этом отзывы публикуются и используются «как есть» с сохранением авторской грамматики и пунктуации. Пользователь несет ответственность за достоверность сведений, содержащихся в оставленных им отзывах.&lt;/p&gt;\r\n&lt;p&gt;\r\n	Сервис вправе самостоятельно и без уведомления пользователей отбирать отзывы для публикации, в том числе:&lt;/p&gt;\r\n&lt;ul&gt;\r\n	&lt;li&gt;\r\n		не публиковать отзывы, содержание которых не относится к тематике работы магазина, осуществлению покупок в нем;&lt;/li&gt;\r\n	&lt;li&gt;\r\n		не публиковать отзывы о товарах, содержание которых не относится к реальному опыту использования данного товара;&lt;/li&gt;\r\n	&lt;li&gt;\r\n		не публиковать отзывы, которые не содержат полезной информации для других пользователей;&lt;/li&gt;\r\n	&lt;li&gt;\r\n		не публиковать отзывы, которые содержат ненормативную лексику, высказывания оскорбительного характера;&lt;/li&gt;\r\n	&lt;li&gt;\r\n		не публиковать отзывы, содержащие ссылки на другие веб-сайты;&lt;/li&gt;\r\n	&lt;li&gt;\r\n		удалить опубликованный отзыв в любое время;&lt;/li&gt;\r\n	&lt;li&gt;\r\n		самостоятельно определять срок, в течение которого отзывы считаются актуальными и на который они публикуются в рамках Сервиса;&lt;/li&gt;\r\n	&lt;li&gt;\r\n		Сервис не принимает на себя обязательств сообщать пользователю(-ям) о причинах отклонения публикации и/или удаления ранее опубликованных отзывов и оценок.&lt;/li&gt;\r\n&lt;/ul&gt;\r\n&lt;p&gt;\r\n	Если товарное предложение на Сервисе показано со скидкой, то размер такой скидки определяется автоматически на основе предоставленной магазином информации о новой и старой цене путем вычитания новой цены из старой, определения размера скидки в процентах от старой цены и округления итогового значения скидки до целого числа по общематематическим правилам.&lt;/p&gt;\r\n&lt;p&gt;\r\n	Пользуясь Сервисом, Пользователь в соответствии с ч. 1 ст. 18 «О рекламе» дает свое согласие на получение сообщений рекламного характера. Пользователь вправе отказаться от получения сообщений рекламного характера путем отключения соответствующего функционала в настройках.&lt;/p&gt;\r\n&lt;p&gt;\r\n	&lt;em&gt;Дата публикации 26.10.2015 г.&lt;/em&gt;&lt;/p&gt;\r\n');
